		if(annotationEntity.getRelatedEntity("APPLICANT") == null) {
			
			actor = new Applicant();

		} else {
			
			actor = new Defendant();
		}
		
		actor.setPosition(position);
		String textNoAnnotations = Util.removeAllAnnotations(yytext());
		actor.setText(textNoAnnotations);
				
		actor.addRelatedEntity(annotationEntity);
		annotationEntity.addRelatedEntity(actor);
